import styled from 'styled-components'

const StyledButton = styled.button`
    background-color: #6750a4;
    border:none;
    color:#fff;
    padding:16px;
`;

function Button({children}){
    return(
        <StyledButton>{children}</StyledButton>
    )
}

export default Button
